import React from "react";

import './SearchPopup.css'

function SearchPopup(props) {

  return (
    <div className='container-searchPopup'>
      
       <h2>Search</h2>
       <p>Destination</p>
       <input type='text' />
       <p>Check-in Date</p>
       <input />
       
    </div> 
  )

}

export default SearchPopup
